import React from 'react';
import { AppBar, Toolbar, Typography, styled } from '@mui/material';

const Header = styled(AppBar)`
background : #111111;

`
const Tabs = styled(Typography)`
    font-size: 20px;

`

const NavBar = () =>  {
    return (
            <React.Fragment>
                 <Header>

                    <Toolbar >
                        <Tabs> Depp coding  </Tabs>
                        <Tabs> User List </Tabs>
                        <Tabs> Add User </Tabs>
                    </Toolbar>  
             </Header>
            </React.Fragment>
        
            
        
        
    );
}

export default NavBar;
